*CEI Carlos Soublette celebró el Día de las Madres por todo lo alto*

***Las madres y representantes disfrutaron de diferentes actividades llevadas a cabo por el colectivo institucional.

Con una gran y amplia programación se llevó a cabo una actividad dirigida a todas las madres y representantes de los niños del Centro de Educación Inicial (CEI) Carlos Soublette del CDCE Juan Ignacio Montilla del municipio Valera cumpliéndose así la celebración en su honor.

Estás actividades fueron programadas por el colectivo institucional y coordinadas por el equipo directivo y docentes, ambientalistas y cocineras de la Patria.

El Prof. Pedro Briceño director encargado de la institución indicó que está actividad se contó  con la presencia de Payasita Rosita quien puso a disfrutar a más de una con sus dinámicas y bailoterapia para así agasajar a todas las mamás de los niños.

De igual manera las madres disfrutaron de un bello compartir en sus respectivos espacios educativos la cuál se contó con los respectivos regalos hechos por los niños con el apoyo de las docentes de aulas, finalizó el Prof. Pedro Briceño director encargado del CEI Carlos Soublette.

📝 Lcdo. Yovany Calderón.
