*Gobernación de Trujillo dió respuesta inmediata a la vialidad en el municipio Urdaneta*

Desde las primeras horas del día de hoy se iniciaron los trabajos a fin de restablecer el paso vehicular entre Estapape, Loma de San Rafael y Chorro Blanco, parroquia La Quebrada, municipio Urdaneta dándole respuesta inmediata a las comunidades afectadas.

La Información la dió a conocer el Ing. Carlos Gil Director General de Desarrollo Agroecológico de la Gobernación del estado Trujillo.

Señaló el Ing. Gil que debido a los torrenciales aguaceros ocurrido ayer en horas de la tarde causó deslaves considerables y provocó el aumento desmesurado del caudal en quebradas y zanjones, sostuvo .

Nuestra respuesta fué inmediata por parte del Gobierno Revolucionario y se hace posible la normalización de la situación en tiempo récord, cumpliendo instrucciones de nuestro gobernador Gerardo Márquez quién ha estado pendiente a través del Estado Mayor para las Emergencias donde se ha contado con el apoyo de productores solidarios, como es el caso de Alirio Viloria quien ha puesto a disposición una máquina para ejecutar los trabajos coordinados por la Dirección General de Desarrollo Agroecológico de la gobernación de Trujillo, cumpliendo una meta más de nuestro presidente obrero Nicolás Maduro en materia de vialidad agrícola, finalizo el Director General de Desarrollo Agroecológico Ing. Carlos Gil.

📝 Lcdo. Yovany Calderón 
